interface Props{
    visible: boolean;
    score: number;
}
export default function QuizResult(props: Props){
    const { visible, score } = props
    return (
        <>
            {visible && 
                <div className="flex justify-center">
                    <div className="text-3xl">Score : {score}</div>
                </div>
            }
        </>
    )
}
